import React from 'react';

const Navbar = () => {
  return (
    <nav className="navbar">
      <img src={process.env.PUBLIC_URL + '/logo.png'} alt="Dia Wine Logo" className="logo" />
      <h2>DASHBOARD DIA WINE</h2>
    </nav>
  );
};

export default Navbar;
